? "This code is used when data for a given category are missing and are included in\
  \ another category, sub-total or total. Generally where code \u201CK\u201D is used\
  \ there should be a corresponding code \"W - Includes data from another category\"\
  \ assigned to the over-covered category. Implementers and data reporters should\
  \ use the COMMENT_OBS observation-level attribute to specify under which category\
  \ the data are included."
: es: "Este c\xF3digo se utiliza cuando faltan datos de una categor\xEDa determinada\
    \ y se incluyen en otra categor\xEDa, subtotal o total. Generalmente, cuando se\
    \ utiliza el c\xF3digo \"K\" debe haber un c\xF3digo correspondiente \"W - Incluye\
    \ datos de otra categor\xEDa\" asignado a la categor\xEDa cubierta en exceso.\
    \ Los implementadores y los informadores de datos deber\xE1n utilizar el atributo\
    \ de nivel de observaci\xF3n COMMENT_OBS para especificar bajo qu\xE9 categor\xED\
    a se incluyen los datos."
